import * as React from 'react';
import './App.css';
import {Page} from "./component/Page";

function App() {
    const[pageNumber, setPageNumber] = React.useState<number>(1);

    return (
        <div style={{height: 10000}}>
            <Page pageNumber={1}/>
            <p>
                hodsa<br/>hodsa<br/>hodsa<br/>hodsa<br/>hodsa<br/>hodsa<br/>hodsa<br/>
            </p>
        </div>
    );
}

export default App;
